import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { Text, Button, View, Alert, Image,TouchableOpacity,Switch } from 'react-native';
import {styles, buttons} from './style';
//import Navigator from './routes/homeStack';

export default function App() {
  const alertHandler = () => {
    Alert.alert('consumer pressed')
  }
  return (
    <View style={"container"}>
    <TouchableOpacity >
      <Image
        style = {"arrow_image"}
        source={require('./images/icon/2/Arrow_left.png')}
      />
    </TouchableOpacity>

    <Text style = "service">服务详情</Text>
    <Image
      style = "choice"
      source = {require('./images/icon/2/choice.png')}
    />

    <Touchable-opacity style="onsite-wrapper">
      <Text style="onsite-text">上门做饭</Text>
    </Touchable-opacity>

    <Text style="caption">口味可自行挑选，一餐1-5道菜。</Text>
    <View style ="switch_container">
      <Switch style="tick1"
          value="value"
          onValueChange="handleChange"
        />
      <Text style="switch_text">如需额外购买食材将收取$20。</Text>
    </View>

    <TouchableOpacity style="clean-wrapper">
      <Text style="onsite-text">上门清洁</Text>
    </TouchableOpacity>
    <Text style="caption2">包括地面，门窗，垃圾清洁等。</Text>

    <TouchableOpacity style="care-wrapper">
      <Text style="onsite-text">照顾老/幼</Text>
    </TouchableOpacity>
    <Text style="caption2">日常生活料理等。</Text>

    <View style ="comment_container">
      <Image style="comment"
          source = {require('./images/icon/2/comment.png')}
        />
      <TouchableOpacity >
      <Image style = "comment_image"
        source= {require('./images/icon/2/Arrow_right.png')}
      />
    </TouchableOpacity>
    </View>
    <Image style = "comments"
        source={require('./images/icon/2/comments.png')}
    />
    <Image style = "bottom"
        source={require('./images/icon/2/bottom.png')}
    />
    <TouchableOpacity style="next-wrapper">
      <Text style="onsite-text">下一步</Text>
    </TouchableOpacity>

    <Image style = "contact"
      source = {require('./images/icon/1/contact.png')}
    />
  </View>
  );
}
